      Hint: SubText
      Value: "Tau-fluvalinate is a pyrethroid insecticide/acaricide that acts on the nervous system by disrupting the neuron sodium channels. It has contact and stomach action. Fluvalinate is used to control a wide range of insects including Lepidoptera, aphids, thrips, leafhoppers, spider mites, etc. However, in the U.S. it is only used in segments other than row crop."
